import React from "react";
import ReactDOM from "react-dom";

function Card(props) {
    return (
       <div>
        <h2>{props.name}</h2>
        <img src={props.img}/>
        <p>{props.tel}</p>
        <p>{props.email}</p>
       </div>
    );
}

ReactDOM.render(
    <div>
    <Card name="Beyonce" 
    img="data:image/jpeg;base64,"
     tel="112123343445"
     email="b@gmail.com" />
     <Card name="Harry Potter" 
    img="data:image/jpeg;base64,"
     tel="1121233445"
     email="h@gmail.com" />
     <Card name="Mr Bean" 
    img="data:image/jpeg;base64,"
     tel="1121233445"
     email="b@gmail.com" />
     </div>,
    document.getElementById("root")
);